Beth Harper (Kristen Bell) is een jonge, ambitieuze New Yorker. Het enige probleem is haar complete ongeluk in de liefde. Maar 
wanneer Beth voor de bruiloft van haar zus naar Rome reist, steelt ze munten uit 'de fontein der liefde'. Dit heeft als gevolg 
dat ze vanaf dat moment continu achtervolgd wordt door verschillende mannen die haar geliefde willen zijn.
